"Don't let anyone tell you what you can and can't accomplish."

WNBA baller and former college superstar @sabrina_i doesn't just want to be a legendary basketball player. She wants to be the greatest. Period. Her love of the game fuels her drive to smash records and expectations. Now, she's challenging young players to keep shaking it upuntil greatness isn't divided by gender. 

Who in your life needs a little of Sabrina's fire? Tag them below.

 @danaboulos
 @jordanligons

"Stop chasing perfection because there's absolutely no point. It doesn't exist." 

World Champion sprinter @dinaashersmith believes you shouldn't hide from your body, you should celebrate it. And that's why she's emerging as a new kind of iconone who is unafraid to drop the truth bombs people need to hear so girls can be unapologetic and confident in whatever sport they try. (THANK  YOU   DINA .)

Who in your life needs to hear Dina's story? Tag them below.

 @flwn__ 
  @ruthossaistudio
 @sophographylondon

"There is hope for many other Ingrids to be part of the dance world.&quot;

@IngridSilva founded @BlacksInBallet to uplift Black dancers in the white-centric ballet world. Growing up in Brazil, she didn't have role models in professional ballet that looked like her. So, she became what she never had.

Follow @BlacksInBallet to see how Ingrid's setting the stage for the future.

: @dayday.studio @bennncareyyy

@kingjameshas been the people's champ ever since he stole the spotlight as a teen. But he's also a champion of the people, using his platform to ensure all the voices in his community are heard and counted.

"It's about all of us looking in the mirror and saying what can we do better to help change?" LeBron knows that change doesn't happen overnight, so his fight for representation goes way beyond the November US election. He's got big plans, but if anyone can pull them off, it's King James.

